import React from "react";
import { NavLink , Outlet} from 'react-router-dom';




const About = () =>{

  
   
    return(
        <>
        <div className="about">
        <div  className="sub_menu">
        <header >
          <ul>
        <li> <NavLink exact activeClassName='active_class' to= '/about/qualification' >Graduation</NavLink></li>
       <li> <NavLink exact activeClassName='active_class' to= '/about/habbits' >Habbits</NavLink></li>
        <li><NavLink exact activeClassName='active_class' to= '/about/personal' >personalinfo</NavLink></li>
        </ul>
        </header>
        </div>
        <Outlet />
        </div>
            
               
        </>
    )
}
export default About ;
